webpackJsonp([7663817265626],{5798:function(t,o){t.exports={data:{post:{html:'<p>I\'m not particularly patriotic, but it wasn\'t without a small amount of pride that I picked up Christopher\'s US passport today.</p>\n<p><img alt="Christopher\'s passport" src="http://www.papascott.de/wordpress/wp-content/uploads/2002/11/crhpass.jpg" width="325" height="273" border="0" /></p>\n<p>Yes, that child looks very skeptical. As an added bonus, he also got a certificate to prove his citizenship.</p>\n<p><img alt="Christopher\'s \'Consular Report of Birth\'" src="http://www.papascott.de/wordpress/wp-content/uploads/2002/11/crhcert.jpg" width="325" height="251" border="0" /></p>',fields:{title:"One Of Us Now",date:"02 Nov 2002",url:"https://papascott.de/2002-11-02-one-of-us-now/"}}},pathContext:{slug:"/2002-11-02-one-of-us-now/",prev:{fields:{title:"Who's On First?",date:"31 Oct 2002",slug:"/2002-10-31-whos-on-first/"}},next:{fields:{title:"Terror Begins At Home",date:"02 Nov 2002",slug:"/2002-11-02-terror-begins-at-home/"}}}}}});
